import { ApiProperty } from '@nestjs/swagger';

export class ProfilePhotoDto {
  @ApiProperty({
    type: String,
    description: 'The original name of the file',
    default: 'example.jpg',
  })
  name: string;

  @ApiProperty({
    type: String,
    description: 'The type extension of the file',
    default: 'jpg',
  })
  type: string;

  @ApiProperty({
    type: Number,
    description: 'The size of the file',
    default: 256,
  })
  size: number;

  @ApiProperty({
    type: String,
    description: 'The photo transformed in base 64 string',
    default:
      'data:image/jpeg;base64,',
  })
  file: string;
}
